def test_diameter(diam_pdu=diam_pdu):
    for dm in (DiameterGeneric(), DiameterIETF(), Diameter3GPP()):
        for pdu in diam_pdu:
            dm.from_bytes(pdu)
            v = dm.get_val()
            dm.reautomate()
            assert( dm.get_val() == v )
            dm.__init__()
            dm.set_val(v)
            assert( dm.to_bytes() == pdu )
            #
            if _with_json:
                t = dm.to_json()
                dm.from_json(t)
                assert( dm.get_val() == v )


